// src/components/AppointmentForm/AppointmentForm.js
// Example appointment form component
import React, { useState } from 'react';
import axios from 'axios';

const AppointmentForm = () => {
    const [formData, setFormData] = useState({
        userId: '',
        doctorId: '',
        date: '',
        time: ''
    });

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            await axios.post('/api/appointments', formData); // Endpoint to submit appointment
            alert('Appointment submitted successfully');
        } catch (error) {
            console.error('Error submitting appointment:', error);
        }
    };

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
    };

    return (
        <div>
            <h2>Appointment Form</h2>
            <form onSubmit={handleSubmit}>
                <div>
                    <label>User ID:</label>
                    <input type="text" name="userId" value={formData.userId} onChange={handleChange} required />
                </div>
                <div>
                    <label>Doctor ID:</label>
                    <input type="text" name="doctorId" value={formData.doctorId} onChange={handleChange} required />
                </div>
                <div>
                    <label>Date:</label>
                    <input type="date" name="date" value={formData.date} onChange={handleChange} required />
                </div>
                <div>
                    <label>Time:</label>
                    <input type="time" name="time" value={formData.time} onChange={handleChange} required />
                </div>
                <button type="submit">Submit</button>
            </form>
        </div>
    );
};

export default AppointmentForm;
